import { useEffect, useState } from "react";
import axios from "axios";

function OrdersManagement() {
  const [orders, setOrders] = useState([]);
  const [formData, setFormData] = useState({
    userName: "",
    ticketCode: "",
    date: "",
    status: "",
  });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = () => {
    axios
      .get("http://localhost:5000/api/orders")
      .then((res) => setOrders(res.data))
      .catch((err) => console.error(err));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (editingId) {
      axios
        .put(`http://localhost:5000/api/orders/${editingId}`, formData)
        .then(fetchOrders);
    } else {
      axios
        .post("http://localhost:5000/api/orders", formData)
        .then(fetchOrders);
    }
    setFormData({ userName: "", ticketCode: "", date: "", status: "" });
    setEditingId(null);
  };

  const handleEdit = (order) => {
    setFormData({
      userName: order.userName,
      ticketCode: order.ticketCode,
      date: order.date,
      status: order.status,
    });
    setEditingId(order.id);
  };

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5000/api/orders/${id}`).then(fetchOrders);
  };

  return (
    <div>
      <h2>Quản lý Đơn đặt hàng</h2>

      <form onSubmit={handleSubmit}>
        <input
          placeholder="Tên người dùng"
          value={formData.userName}
          onChange={(e) =>
            setFormData({ ...formData, userName: e.target.value })
          }
          required
        />
        <input
          placeholder="Mã vé"
          value={formData.ticketCode}
          onChange={(e) =>
            setFormData({ ...formData, ticketCode: e.target.value })
          }
          required
        />
        <input
          type="date"
          value={formData.date}
          onChange={(e) => setFormData({ ...formData, date: e.target.value })}
          required
        />
        <input
          placeholder="Trạng thái"
          value={formData.status}
          onChange={(e) => setFormData({ ...formData, status: e.target.value })}
          required
        />
        <button type="submit">{editingId ? "Cập nhật" : "Thêm"}</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Người dùng</th>
            <th>Mã vé</th>
            <th>Ngày</th>
            <th>Trạng thái</th>
            <th>Hành động</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.id}>
              <td>{order.id}</td>
              <td>{order.userName}</td>
              <td>{order.ticketCode}</td>
              <td>{order.date}</td>
              <td>{order.status}</td>
              <td>
                <button onClick={() => handleEdit(order)}>Chỉnh sửa</button>
                <button onClick={() => handleDelete(order.id)}>Xóa</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrdersManagement;
